import React from 'react';
import OperatorButton from './OperatorButton';
import './Button.css';

const NumberButton = props => {
  return (
    <div className="row">
      <div className="col-3 col-height d-inline-flex justify-content-center d-flex align-items-center border">
        {props.number}
        <OperatorButton />
      </div>
      <div className="col-1 col-height d-inline-flex justify-content-center d-flex align-items-center border">
        <OperatorButton />
      </div>
    </div>
  );
};

export default NumberButton;
